import React from "react";
import Home from "./Home";
import { Switch, Route } from "react-router-dom";

const App = () => {
  return (
    <>
    <Switch>
      <Route  path="/" component={Home} />
    </Switch>
      <Home />
    </>
  );
};

export default App;
